import React from 'react'
import './Home.scss'

const Home = () => {
    return (
        <div className='home'>
            <span className='tag'>&lt;body&gt;</span>
            <div className='title'>

                <h1>Hi, <br /> I'm Rajat, <br /> frontend developer.</h1>
            </div>
        </div>
    )
}

export default Home
